import React from 'react';
import {Link} from 'react-router-dom';

const accommodationTerm = (props) => {
    return (
        <tr>
            <td scope={"col"} style={{ maxWidth: '200px' }}>{props.term.name}</td>
            <td>{props.term.category.valueOf()}</td>
            <td>{props.term.host.name}</td>
            <td>{props.term.numRooms}</td>
            <td>{props.term.isRented}</td>
        </tr>
    )
}

export default accommodationTerm;
